import React, { Component } from 'react';

import OutcomeForm from './OutcomeForm';

export class Outcomes extends Component {
	render() {
		console.log(this.props.outcomes);
		if (this.props.outcomes) {
			const { outcomes } = this.props.outcomes;
		}
		return (
			<MuiThemeProvider>
				<React.Fragment>
					<AppBar title="Learning Outcomes" showMenuIconButton={false} />
					<OutcomeForm />
				</React.Fragment>
			</MuiThemeProvider>
		);
	}
}

const useStyles = makeStyles((theme) => {});

export default Outcomes;
